original_data=zlib.decompress(base64.b85decode(data)).decode().split()
dict_data=[]
dict_set=set()
ans_set=set()
prefix_set=set()

for word in original_data:
    if word[0].isnumeric():
        if word[1].isnumeric():
            cnt=int(word[:2])
            word=word[2:]
        else:
            cnt=int(word[:1])
            word=word[1:]
        word=pword[:cnt]+word
    dict_data.append(word)
    pword=word
    for i in range(1,len(word)+1):
        prefix_set.add(word[:i])
dict_set=set(dict_data)

field=[[0]*7 for i in range(7)]
for i in range(1,6):
    x=input().split()
    for j in range(1,6):
        field[i][j]=x[j-1]

def dfs(si,sj,visit,ss):
    global field
    visit.append((si,sj))
    ss=ss+field[si][sj]
